import create from "zustand";
import axios from 'axios';
import {devtools} from "zustand/middleware";

const useUsers = create(
    devtools((set) => ({
     user:[],
     fetch: async(url) =>{
         const response = await axios.get(url);
         set({user: await response.data})
     }

    }))
);

export default  useUsers;
